const listReducer = (state = {}, action) => {
  state = [
    {
      id: 1,
      name: "Manish",
      age: "23",
    },
    {
      id: 2,
      name: "Abc",
      age: "23",
    },
    {
      id: 3,
      name: "Xyz",
      age: "23",
    },
    {
      id: 4,
      name: "Mandela",
      age: "23",
    },
    {
      id: 5,
      name: "Vipin",
      age: "23",
    },
  ];
  switch (action.type) {
    case "LIST":
      return state.visibleList;
    case "DEM)":
      return state;
  }
  return state.visibleList;
};

export default listReducer;
